webpackJsonp([38230740572776],{1269:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Though I don’t often get a chance to use Articulate Storyline (hoping to change that soon!) I keep up with their community blogs and I like to see what I can do with their challenges. One of the older challenges was to create a branching scenario. I chose <a href="http://www.inc.com/magazine/201310/adam-bluestein/what-kind-of-leader-are-you.html" title="What Kind of Leader are You?">Adam Bluestein’s What Kind of Leader are You flowchart on Inc.com</a></p>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 65.57863501483679%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Interactive home page" title="" src="/static/Leadership-e8b475e12d0759d80499624a16f5a713-1626e.png" srcset="/static/Leadership-e8b475e12d0759d80499624a16f5a713-076ec.png 203w,\n/static/Leadership-e8b475e12d0759d80499624a16f5a713-7ae34.png 405w,\n/static/Leadership-e8b475e12d0759d80499624a16f5a713-1626e.png 810w,\n/static/Leadership-e8b475e12d0759d80499624a16f5a713-f50c4.png 1011w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n</figure>\n<p>Though simple, the project was instructive. I chose to have the decision automatically take the user to the next page but you could add a submit button of some kind, though the way I did it forces the user to make a choice without being able to vacillate. Mostly, it showed that creating branches can be accomplished with relative ease in Lectora. <a href="http://knanthony.com/showcase/leadership/index.html" title="What Kind of Leader are You? (Interactive)">Check the demo here.</a></p>',frontmatter:{date:"October 03, 2014",path:"/blog/weekend-project-mini-branching-scenario",title:"Weekend Project: Mini Branching Scenario",tags:["branching scenario","Lectora","quiz"],categories:["elearning","Weekend Project"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.5248868778280542,src:"/static/Leadership-e8b475e12d0759d80499624a16f5a713-81d39.png",srcSet:"/static/Leadership-e8b475e12d0759d80499624a16f5a713-9a8d1.png 203w,\n/static/Leadership-e8b475e12d0759d80499624a16f5a713-c53f9.png 405w,\n/static/Leadership-e8b475e12d0759d80499624a16f5a713-81d39.png 810w,\n/static/Leadership-e8b475e12d0759d80499624a16f5a713-c4bfc.png 1011w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
